'''Moxazocine''' ('''BL-4566''') is an [[opioid]] [[analgesic]] of the [[benzomorphan]] family which was never marketed.<ref name="Triggle1997">{{cite book | title = Dictionary of Pharmacological Agents Volume 2 | url = http://books.google.com/books?id=A0THacd46ZsC&pg=PA1382 | accessdate = 22 April 2012 | publisher = CRC Press | isbn = 978-0-412-46630-4 | page = 1382}}</ref> It acts as a [[partial agonist]] or mixed [[agonist]]/[[receptor antagonist|antagonist]] of the [[opioid receptor]]s and binds preferentially to the [[κ-opioid receptor]].<ref name="pmid2822190">{{cite journal | author = Hayes AG, Sheehan MJ, Tyers MB | title = Differential sensitivity of models of antinociception in the rat, mouse and guinea-pig to mu- and kappa-opioid receptor agonists | journal = [[British Journal of Pharmacology]] | volume = 91 | issue = 4 | pages = 823–32 |date=August 1987 | pmid = 2822190 | pmc = 1853585 | doi = 10.1111/j.1476-5381.1987.tb11281.x| url = }}</ref> Despite its failure to reach the market, [[clinical trial|clinical studies]] demonstrated moxazocine to be approximately 10x as [[potency (pharmacology)|potent]] by weight as [[morphine]] as an analgesic.<ref name="Dobkin1977">{{cite journal | title = Moxazocine and morphine in patients with severe postoperative pain | authors = Dobkin, Allen B; Esposito, Barbara F; Noveck, Robert J; Caruso, Frank S | journal = Current Therapeutic Research | volume = 22(4) |date=October 1977 | pages = 469–478 | url = http://psycnet.apa.org/psycinfo/1978-23576-001}}</ref>
